@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("shutterfly.com") {

body.sfly{background-image: url('data:image/png;base64,')
!important;background-color:grey!important;}

div.moCoverImgDiv{background-image:none!important;
background-color:RGB(14,22,42)!important;
box-shadow: 0 0 4px 2px black,  
8px -6px RGB(4,59,2), 10px 8px 1px red, 
-7px 3px white, -4px -10px 1px blue!important;
}
.sflyAlbum{border:none!important;}

.moIndexLabel{font-weight:bolder!important;color:black!important;}
.moNameLabel{font-weight:bolder!important;color:black!important;}

.sflyPicture{background-color:grey!important;
border-color:black!important;border-radius:3px!important}
.sflyPicture.wa_med.sflyWorkareaDragItem.dojoDndItem{background-image:none!important;background-color:grey!important;}

div.previewItemDiv,img.largePrevImg{background-color:grey!important;
border-color:black!important;border-radius:3px!important}
}
